{"operationName":"Aura","variables":{"accountId":"","hasAccount":false},"query":"query Aura($accountId: String!, $hasAccount: Boolean!) {
  ...Block
  auraLocker(id: "auraLocker") {
    ...AllAuraLocker
    accounts(where: {account: $accountId}) @include(if: $hasAccount) {
      id
      balance
      balanceLocked
      balanceNextUnlockIndex
      delegate {
        id
        __typename
      }
      userLocks {
        id
        amount
        unlockTime
        __typename
      }
      userData {
        id
        token {
          ...AllToken
          __typename
        }
        rewards
        rewardPerTokenPaid
        __typename
      }
      __typename
    }
    __typename
  }
  auraBal: pool(id: "auraBal") {
    ...AllPool
    accounts(where: {account: $accountId}) @include(if: $hasAccount) {
      ...AllPoolAccount
      __typename
    }
    __typename
  }
  initialAuraBal: pool(id: "initialAuraBalRewards") {
    ...AllPool
    accounts(where: {account: $accountId}) @include(if: $hasAccount) {
      ...AllPoolAccount
      __typename
    }
    __typename
  }
  factoryPools: pools(where: {isFactoryPool: true}) {
    ...AllPool
    accounts(where: {account: $accountId}) @include(if: $hasAccount) {
      ...AllPoolAccount
      __typename
    }
    __typename
  }
  masterChefPoolInfos {
    id
    accCvxPerShare
    allocPoint
    lastRewardBlock
    rewarder
    lpToken {
      ...AllToken
      __typename
    }
    lpSupply
    userInfos(where: {account: $accountId}) @include(if: $hasAccount) {
      id
      amount
      rewardDebt
      __typename
    }
    __typename
  }
}

fragment Block on Query {
  _meta {
    block {
      number
      __typename
    }
    __typename
  }
  __typename
}

